import React, { Component } from "react";
import Expanded from "./Assets/ExpandedInsurence.jpg";
const programs = [
  { title: "Insurence", count: "program COUNT" },
  { title: "Tarnsproting", count: "program COUNT" },
  { title: "Sport", count: "program COUNT" },
  { title: "Meal", count: "program COUNT" },
  { title: "Health", count: "program COUNT" },
  { title: "", count: "program COUNT" },
  { title: "Program 7", count: "program COUNT" },
  { title: "Program 8", count: "program COUNT" },
  { title: "Program 9", count: "program COUNT" },
  { title: "Program 10", count: "program COUNT" },
];
class Benefits extends React.Component {
  render() {
    return (
      <div className="benefits__container">
        {programs.map((program, index) => (
          <div key={index} className="benefits__item ">
            <div className="insurance"></div>
            <h1 className="benefits__item__title">
              {program.title}
              <h4 className="benefits__item__subtitle">{program.count}</h4>
            </h1>
          </div>
        ))}
      </div>
    );
  }
}

export default Benefits;
